  `DBID_` bigint(20) NOT NULL COMMENT '记录标识',
  `CLASS_` varchar(255) NOT NULL COMMENT '鉴别标识',
  `DBVERSION_` int(11) NOT NULL COMMENT '记录版本号',
  `ACTIVITYNAME_` varchar(255) DEFAULT NULL COMMENT '节点名称',
  `PROCDEFID_` varchar(255) DEFAULT NULL COMMENT '发布以后的流程定义标识',
  `HASVARS_` bit(1) DEFAULT NULL COMMENT '拥有变量标识',
