  `KEY_` varchar(255) DEFAULT NULL COMMENT '执行（流程实例）key',
  `ID_` varchar(255) DEFAULT NULL COMMENT '执行（流程实例）ID',
  `STATE_` varchar(255) DEFAULT NULL COMMENT '执行（流程实例）状态',
  `SUSPHISTSTATE_` varchar(255) DEFAULT NULL COMMENT '历史挂起状态',
