  `HISACTINST_` bigint(20) DEFAULT NULL COMMENT '处于活动节点的引用',
  `PARENT_` bigint(20) DEFAULT NULL COMMENT '父执行',
  `INSTANCE_` bigint(20) DEFAULT NULL COMMENT '流程实例',
