  `COMMITERID` varchar(32) NOT NULL COMMENT '创建人ID',
  `MODIFIERID` varchar(32) NOT NULL COMMENT '修改人ID'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='工作流流程挂接表';

